import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";

function Navbar({ children }) {
  return (
    <BrowserRouter>
      <div>
        <nav className="navbar navbar-expand navbar-light bg-dark">
          <Switch>
              
          </Switch>
        </nav>
        {children}
      </div>
    </BrowserRouter>
  );
}

export default Navbar;
